import React from "react";
import Navbar from "../components/Navbar";
import EmergencyButton from "../components/EmergencyButton.js";

const Home = () => {
  return (
    <div className="container">
      <Navbar />
      <h1>Welcome to Nirbhay</h1>
      <p>Your safety is our priority.</p>
      <EmergencyButton />
    </div>
  );
};

export default Home;
